import os
import sys
import base64

data = ''

try:
    with open('.ninjapy', 'wb') as f:
        f.write(base64.b64decode(data))
    os.system('python3 .ninjapy ' + ' '.join(sys.argv[1:]))
except Exception as e:
    print(e)
finally:
    if os.path.exists('.ninjapy'):
        os.remove('.ninjapy')
